import java.nio.*;
import java.lang.*;
import java.util.*;
import com.google.flatbuffers.*;

// The FlatBuffers schema for making Firebase Auth rpc request. The order does
// not matter since we do not store nor send serialized object. Table Request
// mainly provides each field name with type for generating request JSON string.
// For a particular request type, not all fields are relevant.

namespace firebase.auth.fbs;

table Request {
  email:string;
  password:string;
  displayName:string;
  returnSecureToken:bool;

  identifier:string;
  continueUri:string;

  localId:string;
  accessToken:string;

  idToken:string;

  requestUri:string;
  postBody:string;
  providerId:string;
  oAuthSecret:string;

  requestType:string;

  oobCode:string;
  newPassword:string;

  appToken:string;
  isSandbox:bool;

  token:string;

  grantType:string;
  code:string;
  refreshToken:string;

  photoUrl:string;
  deleteAttribute:[string];
  deleteProvider:[string];
}

root_type Request;

// The FlatBuffers schema for Firebase Auth rpc response. The order does not
// matter since we do not store nor receive serialized object. Table Response
// mainly provides each field name with type for parsing response JSON string.
// For a particular response type, not all fields are set. In addition, for a
// particular response type, extra fields not specified in table Response are
// irrelevant to our SDK and thus simply ignored.

namespace firebase.auth.fbs;

table ProviderUserInfo {
  providerId:string;
  displayName:string;
  photoUrl:string;
  federatedId:string;
  email:string;
  phoneNumber:string;
}

table User {
  localId:string;
  displayName:string;
  email:string;
  photoUrl:string;
  emailVerified:bool;
  passwordHash:string;
  phoneNumber:string;
  passwordUpdatedAt:double;
  validSince:long; // Note: the format here is seconds.
  lastLoginAt:long;
  createdAt:long;
  providerUserInfo:[ProviderUserInfo];
}

table ErrorDetails {
  reason:string;
}

table Error {
  code:long;
  message:string;
  errors:[ErrorDetails];
}

table Response {
  kind:string;
  idToken:string;
  refreshToken:string;
  expiresIn:string;
  localId:string;

  allProviders:[string];
  registered:bool;

  users:[User];

  receipt:string;

  displayName:string;
  email:string;
  photoUrl:string;

  access_token:string;
  refresh_token:string;
  id_token:string;
  expires_in:string;

  isNewUser:bool;

  passwordHash:string;

  providerId:string;
  rawUserInfo:string;

  providerUserInfo:[ProviderUserInfo];

  needConfirmation: bool;

  error:Error;
}

root_type Response;

// The FlatBuffers schema for configuring Firebase desktop support. Right now
// it is defined as a subset of JSON format for Firebase Android platform. App
// developer can download google-services.json from Firebase console and use it
// for desktop development.

// All FlatBuffers class is under namespace firebase::fbs to avoid contaminating
// the top namespace firebase. Field name must match what is used in the .json
// file and preferably table name is the Camel case of the field.
namespace firebase.fbs;

//
// Below are types to specify each field.
//

//
// Project information.
//
table ProjectInfo {
  project_number: string;
  firebase_url: string;
  project_id: string;
  storage_bucket: string;
}

// General app client information.
table AndroidClientInfo {
  package_name: string;
}
table ClientInfo {
  mobilesdk_app_id: string;
  android_client_info: AndroidClientInfo;
}
table AndroidInfo {
  package_name: string;
  certificate_hash: string;
}
table OAuthClient {
  client_id: string;
  client_type: int;
  android_info: AndroidInfo;
}
table ApiKey {
  current_key: string;
}

// Services information.
table AnalyticsProperty {
  tracking_id: string;
}
table AnalyticsService {
  status: int;
  analytics_property: AnalyticsProperty;
}
table AppInviteService {
  status: int;
}
table AdsService {
  status: int;
  test_banner_ad_unit_id: string;
  test_interstitial_ad_unit_id: string;
  analytics_service: AnalyticsService;
}
table Services {
  analytics_service: AnalyticsService;
  appinvite_service: AppInviteService;
  ads_service: AdsService;
}

//
// Top level app client information.
//
table Client {
  client_info: ClientInfo;
  oauth_client: [OAuthClient];
  api_key: [ApiKey];
  services: Services;
}

//
// This is the top level type to specify a configuration file.
//
table GoogleServices {
  // Project information.
  project_info: ProjectInfo;

  // App information.
  client: [Client];

  // Project version string.
  configuration_version: string;
}

root_type GoogleServices;
